import React from "react";
import style from './Button.module.css';

const Button = (props) => {
    const sayMeClick = () => {
        console.log('click')
    }
    return (
        <button onClick={sayMeClick}
            className={style['floating-button']}>{props.children}
        </button>
    )
}

export default Button;
